import React, { useState } from 'react';
import Box from '@mui/material/Box';
import Drawer from '@mui/material/Drawer';
import Button from '@mui/material/Button';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemText from '@mui/material/ListItemText';
import MenuIcon from '@mui/icons-material/Menu';
import './Navbar.css'; // Importar o arquivo CSS para estilização

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggleDrawer = (open) => (event) => {
    if (event.type === 'keydown' && (event.key === 'Tab' || event.key === 'Shift')) {
      return;
    }
    setIsOpen(open);
  };

  const list = () => (
    <Box
      sx={{ width: 250 }}
      role="presentation"
      onClick={toggleDrawer(false)}
      onKeyDown={toggleDrawer(false)}
    >
      <List>
        <ListItem key="home" disablePadding>
          <ListItemButton href="#home">
            <ListItemText primary="Home" />
          </ListItemButton>
        </ListItem>
        <ListItem key="about" disablePadding>
          <ListItemButton href="#about">
            <ListItemText primary="Sobre" />
          </ListItemButton>
        </ListItem>
        <ListItem key="portfolio" disablePadding>
          <ListItemButton href="#portfolio">
            <ListItemText primary="Portfólio" />
          </ListItemButton>
        </ListItem>
        <ListItem key="contact" disablePadding>
          <ListItemButton href="#contact">
            <ListItemText primary="Contato" />
          </ListItemButton>
        </ListItem>
      </List>
    </Box>
  );

  return (
    <nav className="navbar">
      <div className="logo">Nery</div>
      <Button onClick={toggleDrawer(true)} aria-label="Toggle navigation">
        <MenuIcon />
      </Button>
      <Drawer
        anchor="right"
        open={isOpen}
        onClose={toggleDrawer(false)}
      >
        {list()}
      </Drawer>
    </nav>
  );
};

export default Navbar;
